import React from 'react'

class AvatarList extends React.Component{
    render(){
        return(
            <div>
                
                <img src = "https://joeschmoe.io/api/v1/ram" />
                <h1>hello {this.props.name} </h1>
            </div>
        )
            
        
    }
}

export default AvatarList;
